import React from "react";

import classes from "./ErrorModal.module.css";
import Button from "./Button";
import Card from "../Card/Card";

const ErrorModal = (props) => {
  return (
    <div>
      <Card>
        <header>{props.title}</header>
        <h3>{props.message}</h3>
        <Button>Okay</Button>
      </Card>
    </div>
  );
};

export default ErrorModal;
